@notice Claim native assets of the chain (Assisted)
@dev Requirements:
@dev - The function initiator must have the claim role
@dev - {client} must have a valid vault deployed
@dev - At least {amount} of native asset must be owned by the vault of the Client
@dev - {recipient} cannot be a zero address
@dev Emits a {Claim} event
@param client The name of the Client
@param amount The amount of the native asset
@param recipient The wallet address of the recipient

@notice Claim ERC20 assets or an ERC721 asset (Assisted)
@dev Requirements:
@dev - The function initiator must have the claim role
@dev - {collection} must be supported by this contract
@dev - {collection} must be an ERC20 or ERC721 collection
@dev - {client} must have a valid vault deployed
@dev - {asset} must be owned by the vault of the Client
@dev - {recipient} cannot be a zero address
@dev - {recipient} must have the {IERC721ReceiverUpgradeable} interface if it is a smart contract
@dev Emits a {Transfer} and {ClaimERC20} or {ClaimERC721} event
@param client The name of the Client
@param collection The name of the collection
@param asset The amount of the ERC20 asset or the token id of the ERC721 asset
@param recipient The wallet address of the recipient

@notice Claim ERC1155 assets (Assisted)
@dev Requirements:
@dev - The function initiator must have the claim role
@dev - {collection} must be supported by this contract
@dev - {collection} must be an ERC1155 collection
@dev - {client} must have a valid vault deployed
@dev - At least {amount} of {tokenId} must be owned by the vault of the Client
@dev - {recipient} cannot be a zero address
@dev - {recipient} must have the {IERC1155ReceiverUpgradeable} interface if it is a smart contract
@dev Emits a {TransferSingle} and {ClaimERC1155} event
@param client The name of the Client
@param collection The name of the collection
@param tokenId The token id of the ERC1155 asset
@param amount The amount of the ERC1155 asset
@param recipient The wallet address of the recipient

@notice Deploy a new proxy smart contract for a Client Vault
@dev Requirements:
@dev - The function initiator must have the default admin role
@dev - There must not be a previously deployed Client Vault for `name`
@dev Emits a {ClientVaultDeployment} and {Upgraded} event
@param name The name of the Client
@param bytecode The bytecode of the proxy contract

@notice Manage an NFT collection
@dev Requirements:
@dev - The function initiator must have the default admin role
@dev - {asset} must not be a zero address
@dev - {asset} must not be an EOA address
@dev - The token standard of {asset} must match {token}
@dev Emits a {CollectionAdded}, {CollectionRemoved}, or {CollectionAmended} event
@param name The collection name
@param token The collection token standard
@param asset The collection contract address
@param supported Indicate if the collection is supported

@notice Initialize a Proxy contract and sets the address of the administrative and the CLAIM_ROLE slot
@dev Requirements:
@dev - The Proxy contract have not been initialized before
@dev Emits an {Initialized} event

@dev Increment or decrement the total collection count
@param token The collection token standard
@param shouldInc Indication of whether the collection count should be incremented

@dev Add a new collection
@dev Emits a {CollectionAdded} event
@param name The collection name
@param token The collection token standard
@param asset The collection contract address

@dev Amend an existing collection
@dev If `supported`, will perform an amendment. Otherwise, will perform a deletion.
Emits a {CollectionRemoved} or {CollectionAmended} event
@param name The collection name
@param token The collection token standard
@param asset The collection contract address
@param supported Indicate if the collection is supported
@param collection The current collection details

@notice Verifies if a given contract address matches a specified collection token standard
@dev Not applicable for ERC20 token standard as ERC165 is not supported
@param token The collection token standard
@param asset The contract address to check
@return bool Indication of whether the contract address matches the specified collection token standard

@notice Compute the address of the Client Vault to be deployed
@param name The name of the Client
@param bytecode The bytecode of the proxy smart contract to be deployed
@return address The computed Client Vault address
